import React, { FC } from "react";
import { Wrapper } from "../../components/Wrapper/styles";
import { Clock } from "../../components/Clock/clock";
import { Navbar } from "../../components/Navbar/navbar";

interface MainProps {}

export const MainScreen: FC<MainProps> = () => {
  return (
    <Wrapper>
      <Clock />
      <Navbar />
    </Wrapper>
  );
};
